// src/Home.js
import React from 'react';

function Home() {
    return (
        <div className="home">
            <header className="home-header">
                <h1>Bine ai venit la Dealer Auto</h1>
                <p>Descoperă cele mai bune oferte de mașini noi și rulate!</p>
            </header>
            <main className="home-content">
                <p>
                    La Dealer Auto, oferim o selecție variată de vehicule pentru toate gusturile și bugetele.
                </p>
                <p>
                    Vizitează secțiunea noastră de oferte pentru a găsi mașina perfectă pentru tine!
                </p>
            </main>
        </div>
    );
}

export default Home;
